int lea_mmt_ecb_test(void)
{
    unsigned int i;
    unsigned char encrypted[176];
    unsigned char decrypted[176];
    //LEA_KEY key;

    for (i = 0; i < 10; i++)
    {
        
        memset(encrypted, 0, sizeof(encrypted));
        memset(decrypted, 0, sizeof(decrypted));

        //LEA_Key_Schedule(&key, lea128_mmt_ecb[i].key, 16);

        ECB_LEA_Enc(encrypted, lea128_mmt_ecb[i].p, lea128_mmt_ecb[i].key, (i + 1), 16);

        if (memcmp(encrypted, lea128_mmt_ecb[i].c, (i + 1) * 16))
            return -1;

        ECB_LEA_Dec(decrypted, lea128_mmt_ecb[i].c, lea128_mmt_ecb[i].key, (i + 1), 16);

        if (memcmp(decrypted, lea128_mmt_ecb[i].p, (i + 1) * 16))
            return -2;

        //printf("LEA128 MMT ECB %d round done...\n", i);
    }

    for (i = 0; i < 10; i++)
    {
        memset(encrypted, 0, sizeof(encrypted));
        memset(decrypted, 0, sizeof(decrypted));
        
        ECB_LEA_Enc(encrypted, lea192_mmt_ecb[i].p, lea192_mmt_ecb[i].key, (i + 1), 24);

        if (memcmp(encrypted, lea192_mmt_ecb[i].c, (i + 1) * 16))
            return -3;

        ECB_LEA_Dec(decrypted, encrypted, lea192_mmt_ecb[i].key, (i + 1), 24);

        if (memcmp(decrypted, lea192_mmt_ecb[i].p, (i + 1) * 16))
            return -4;

       // printf("LEA192 MMT ECB %d round done...\n", i);
    }

    for (i = 0; i < 10; i++)
    {

        memset(encrypted, 0, sizeof(encrypted));
        memset(decrypted, 0, sizeof(decrypted));

        ECB_LEA_Enc(encrypted, lea256_mmt_ecb[i].p, lea256_mmt_ecb[i].key, (i + 1), 32);

        if (memcmp(encrypted, lea256_mmt_ecb[i].c, (i + 1) * 16))
            return -5;

        ECB_LEA_Dec(decrypted, encrypted, lea256_mmt_ecb[i].key, (i + 1), 32);

        if (memcmp(decrypted, lea256_mmt_ecb[i].p, (i + 1) * 16))
            return -6;

        //printf("LEA256 MMT ECB %d round done...\n", i);
    }

    printf("LEA MMT ECB : success\n");

    return 0;
}

